import axios from "axios";

const API_URL = "http://localhost:9087";

const login = (credentials) => {
  return axios.post(`${API_URL}/login`, credentials, {
    headers: { "Content-Type": "application/json" },
  });
};

const authService = {
  login,
};

export default authService;
